// src/components/GenerateReport.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const GenerateReport = () => {
  const [students, setStudents] = useState([]);
  const [vaccineFilter, setVaccineFilter] = useState('');
  const [currentPage, setCurrentPage] = useState(1);
  const [studentsPerPage] = useState(10);

  const fetchStudents = async () => {
    try {
      const response = await axios.get('/api/v1/students/vaccination-details', {
        params: {
          vaccineName: vaccineFilter,
          page: currentPage,
          size: studentsPerPage,
        },
      });
      setStudents(response.data.content || []);
    } catch (error) {
      console.error('Error fetching students:', error);
    }
  };

  useEffect(() => {
    fetchStudents();
  }, [vaccineFilter, currentPage]);

  const handleDownload = async (fileType) => {
    try {
      const response = await axios.get(`/v1/vaccine-drive/register/download`, {
        params: {
          fileDownloadType: fileType,
        },
        responseType: 'blob',
      });

      const url = window.URL.createObjectURL(new Blob([response.data]));
      const link = document.createElement('a');
      link.href = url;
      link.setAttribute('download', `vaccination_report.${fileType.toLowerCase()}`);
      document.body.appendChild(link);
      link.click();
      link.remove();
    } catch (error) {
      console.error('Error downloading report:', error);
    }
  };

  const handleFilterChange = (e) => {
    setVaccineFilter(e.target.value);
    setCurrentPage(1); // reset to page 1
  };

  const handlePageChange = (pageNumber) => {
    setCurrentPage(pageNumber);
  };

  return (
    <div className="p-4">
      <h2 className="text-xl font-bold mb-4">Generate Vaccination Reports</h2>

      {/* Filter Section */}
      <div className="mb-4 flex gap-4">
        <input
          type="text"
          value={vaccineFilter}
          onChange={handleFilterChange}
          placeholder="Filter by Vaccine Name"
          className="border p-2 rounded"
        />

        <button
          onClick={() => handleDownload('CSV')}
          className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
        >
          Download CSV
        </button>

        <button
          onClick={() => handleDownload('PDF')}
          className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded"
        >
          Download PDF
        </button>
      </div>

      {/* Students Table */}
      <div className="overflow-x-auto">
        <table className="min-w-full bg-white border">
          <thead className="bg-gray-200">
            <tr>
              <th className="py-2 px-4 border">Student Name</th>
              <th className="py-2 px-4 border">Vaccination Status</th>
              <th className="py-2 px-4 border">Vaccination Date</th>
              <th className="py-2 px-4 border">Vaccine Name</th>
            </tr>
          </thead>
          <tbody>
            {students.length === 0 ? (
              <tr>
                <td colSpan="4" className="text-center py-4">No records found</td>
              </tr>
            ) : (
              students.map((student, index) => (
                <tr key={index} className="text-center">
                  <td className="py-2 px-4 border">{student.studentName}</td>
                  <td className="py-2 px-4 border">{student.vaccinationStatus ? 'Vaccinated' : 'Not Vaccinated'}</td>
                  <td className="py-2 px-4 border">{student.vaccinationDate ? new Date(student.vaccinationDate).toLocaleDateString() : 'N/A'}</td>
                  <td className="py-2 px-4 border">{student.vaccineName}</td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>

      {/* Pagination */}
      <div className="flex justify-center mt-4">
        <button
          onClick={() => handlePageChange(currentPage - 1)}
          disabled={currentPage === 1}
          className="bg-gray-300 hover:bg-gray-400 text-gray-800 font-bold py-2 px-4 rounded-l"
        >
          Prev
        </button>
        <span className="py-2 px-4">{currentPage}</span>
        <button
          onClick={() => handlePageChange(currentPage + 1)}
          className="bg-gray-300 hover:bg-gray-400 text-gray-800 font-bold py-2 px-4 rounded-r"
        >
          Next
        </button>
      </div>
    </div>
  );
};

export default GenerateReport;
